import NavTray from "./NavTray"
import NewThreadButton from "./NewThreadButton"
import ThreadsTray from "./ThreadsTray"
import NewFreewriteThreadButton from "./NewFreewriteThreadButton"
import FreeWriteThreadsTray from "./FreeWriteThreadsTray"
import NewBrainstormButton from "./NewBrainstormButton"
import BrainstormThreadsTray from "./BrainstormThreadsTray"
import ModeSelector from "./ModeSelector"

const Left = ({
	showNav,
	selectedMode,
	setSelectedMode,
	threads,
	setThreads,
	selectedThread,
	setSelectedThread,
	setShowChatModal,
	freewriteThreads,
	setFreewriteThreads,
	selectedFreewriteThread,
	setSelectedFreewriteThread,
	setShowCTASubscribed,
	brainstormThreads,
	setBrainstormThreads,
	selectedBrainstormThread,
	setSelectedBrainstormThread,
	setShowBrainstormModal,
	subscription,
}) => {
	return (
		<div
			className={
				showNav
					? "min-w-[20%] flex flex-col h-screen justify-start items-center bg-delilahPrimary pt-4"
					: "left-closed"
			}
		>
			<ModeSelector
				selectedMode={selectedMode}
				setSelectedMode={setSelectedMode}
			/>

			{selectedMode === "brainstorm" && (
				<>
					<NewBrainstormButton
						setShowBrainstormModal={setShowBrainstormModal}
						setShowCTASubscribed={setShowCTASubscribed}
					/>

					<BrainstormThreadsTray
						brainstormThreads={brainstormThreads}
						setBrainstormThreads={setBrainstormThreads}
						selectedBrainstormThread={selectedBrainstormThread}
						setSelectedBrainstormThread={setSelectedBrainstormThread}
					/>
				</>
			)}

			{selectedMode === "chat" && (
				<>
					<NewThreadButton
						threads={threads}
						setThreads={setThreads}
						selectedThread={selectedThread}
						setSelectedThread={setSelectedThread}
						setShowChatModal={setShowChatModal}
						setShowCTASubscribed={setShowCTASubscribed}
					/>

					<ThreadsTray
						threads={threads}
						setThreads={setThreads}
						selectedThread={selectedThread}
						setSelectedThread={setSelectedThread}
					/>
				</>
			)}

			{selectedMode === "freewrite" && (
				<>
					<NewFreewriteThreadButton
						freewriteThreads={freewriteThreads}
						setFreewriteThreads={setFreewriteThreads}
						setSelectedFreewriteThread={setSelectedFreewriteThread}
						setShowCTASubscribed={setShowCTASubscribed}
					/>

					<FreeWriteThreadsTray
						freewriteThreads={freewriteThreads}
						setFreewriteThreads={setFreewriteThreads}
						selectedFreewriteThread={selectedFreewriteThread}
						setSelectedFreewriteThread={setSelectedFreewriteThread}
					/>
				</>
			)}

			<NavTray setSelectedMode={setSelectedMode} subscription={subscription} />
		</div>
	)
}

export default Left
